import React, { Component } from 'react';
import {Link} from "react-router-dom";

class Home extends Component{
    render(){
        return(
            <div>
                <p>HELLO FROM THE HOME PAGE</p>
                <nav>
                    <ol>
                        <li>
                        <Link to = {'./assets'}>
                    View Assets
                </Link>
                        </li>
                    </ol>
                
                <Link to = {"/workorders"}>
                   View WorkOrders
                </Link>
                </nav>

            </div>
        )
    }
}

export default Home;
